// GroupMessageByMessageId retrieves a row from 'ms.group_message' as a GroupMessage.
//
// Generated from index 'group_message_MessageId_pkey'.
func GroupMessageByMessageId(db XODB, messageId int) (*GroupMessage, error) {
	var err error

	// sql query
	const sqlstr = `SELECT ` +
		`MessageId, RoomKey, UserId, MessageFileId, MessageTypeEnum, Text, CreatedMs, DeliveryStatusEnum ` +
		`FROM ms.group_message ` +
		`WHERE MessageId = ?`

	// run query
	XOLog(sqlstr, messageId)
	gm := GroupMessage{
		_exists: true,
	}

	err = db.QueryRow(sqlstr, messageId).Scan(&gm.MessageId, &gm.RoomKey, &gm.UserId, &gm.MessageFileId, &gm.MessageTypeEnum, &gm.Text, &gm.CreatedMs, &gm.DeliveryStatusEnum)
	if err != nil {
		XOLogErr(err)
		return nil, err
	}

	OnGroupMessage_LoadOne(&gm)

	return &gm, nil
}
